  var p = await new Promise((resolve, reject) => {
    setTimeout(() => {
      resolve({ test: "test" });
    }, 3000);
  });
  console.log(p);
  return p;
}
const Test = () => {
  const ttk = tt();
  return <App ttk={ttk.test} />;
};
